import React from 'react';

const WineList = () => {
  const wineData = [
    { id: 1, name: 'Wine A', type: 'Red', alcohol: 13.5, acidity: 3.1, quality: 8 },
    { id: 2, name: 'Wine B', type: 'White', alcohol: 11.8, acidity: 2.9, quality: 7 },
    // Add more sample data here if needed
  ];

  return (
    <div>
      <h1>Wine List</h1>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Type</th>
            <th>Alcohol</th>
            <th>Acidity</th>
            <th>Quality</th>
          </tr>
        </thead>
        <tbody>
          {Data.map((wine) => (
            <tr key={wine.id}>
              <td>{wine.id}</td>
              <td>{wine.name}</td>
              <td>{wine.type}</td>
              <td>{wine.alcohol}</td>
              <td>{wine.acidity}</td>
              <td>{wine.quality}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default WineList;
